import React, { Component } from "react";
import axios from "axios";
const stackexURl = "https://api.stackexchange.com/questions?site=stackoverflow";
class Stackex extends Component {
  constructor() {
    super();
    this.state = {
      data: [
        {
          tags: [],
          owner: {}
        }
      ]
    };
  }
  componentDidMount() {
    axios
      .get(`${stackexURl}`)
      .then(res => this.setState({ data: res.data.items }));
    //   .then(res => console.log(res.data.items.map(a => a)));
  }
  render() {
    console.log(this.state.data);
    return <div>{this.state.data}</div>;
  }
}

export default Stackex;
